import React, { useState } from 'react';
import Header from './component/Header';
import Todo from './component/TodoList';
import AddTodoForm from './component/CreateTodo';

function App() {
  const [todos, setTodos] = useState({
    id: 1,
    text: '',
    checked: false
  });
  return (
    <>
      <Header />
      <AddTodoForm />
      <Todo todos={todos} />
    </>
  );
}

export default App;
